import React from "react";
import TextInput from "./TextInput";
function StampForm(props) {
  const {
    jobName,
    setJobName,
    jobCode,
    setJobCode,
    preparedFor,
    setPreparedFor,
    preparedBy,
    setPreparedBy,
    date,
    setDate,
    isRevision,
    setIsRevision,
    jobPhase,
    setJobPhase,
    gradientStyle,
    setGradientStyle,
    dateFormat,
    setDateFormat,
    revisionNumber,
    setRevisionNumber,
  } = props;

  return (
    <div>
      <p>Stamp Form</p>
    </div>
  );
}

export default StampForm;
